        return False

    color_map = {}
    letter_map = {}

    for c, l in zip(colors, letters):
        if c not in color_map:
            color_map[c] = l
        if l not in letter_map:
            letter_map[l] = c
        if color_map[c] != l or letter_map[l] != c:
            return False

    return True

