def find_solution(a, b, n):
    def extended_gcd(a, b):
        if b == 0:
            return a, 1, 0
        gcd, x1, y1 = extended_gcd(b, a % b)
        x = y1
        y = x1 - (a // b) * y1
        return gcd, x, y

    gcd, x, y = extended_gcd(a, b)
    if n % gcd != 0:
        return None
    factor = n // gcd
    x *= factor
    y *= factor
    return (x, y)

