def find_kth(arr1, arr2, k):
    if not arr1:
        return arr2[k]
    if not arr2:
        return arr1[k]

    mid1 = len(arr1) // 2
    mid2 = len(arr2) // 2

    if mid1 + mid2 < k:
        if arr1[mid1] > arr2[mid2]:
            return find_kth(arr1, arr2[mid2 + 1:], k - mid2 - 1)
        else:
            return find_kth(arr1[mid1 + 1:], arr2, k - mid1 - 1)
    else:
