def get_total_number_of_sequences(m, n):
    def count_sequences(prev, length):
        if length == 0:
            return 1
        count = 0
        for i in range(2 * prev, m + 1):
            count += count_sequences(i, length - 1)
        return count

    total_count = 0
    for i in range(1, m + 1):
        total_count += count_sequences(i, n - 1)

    return total_count

