def get_max_sum(n, memo={}):
    if n == 0:
        return 0
    if n in memo:
        return memo[n]

    memo[n] = max(n, get_max_sum(n//2, memo) + get_max_sum(n//3, memo) + get_max_sum(n//4, memo) + get_max_sum(n//5, memo))
    return memo[n]

