def get_max_sum(n, memo=None):
    if memo is None:
        memo = {}
    if n in memo:
        return memo[n]
    if n == 0:
        return 0
    max_sum = n
    for divisor in [2, 3, 4, 5]:
        if n % divisor == 0:
            max_sum = max(max_sum, get_max_sum(n // divisor, memo) + n)
    memo[n] = max_sum
    return max_sum

assert get_max_sum(60) == 106

