def max_sub_array_sum_repeated(arr, n, k):
    total_sum = sum(arr) * k
    max_ending_here = max_so_far = arr[0]
    for i in range(1, n * 2):
        max_ending_here = max(arr[i % n], max_ending_here + arr[i % n])
        max_so_far = max(max_so_far, max_ending_here)
    if k == 1:
        return max_so_far
    prefix_sum = suffix_sum = arr[0]
    max_prefix_sum = max_suffix_sum = arr[0]
    for i in range(1, n):
        prefix_sum += arr[i]
        max_prefix_sum = max(max_prefix_sum, prefix_sum)
        suffix_sum += arr[n - 1 - i]
        max_suffix_sum = max(max_suffix_sum, suffix_sum)
    if total_sum > 0:
        return max(max_so_far, max_prefix_sum + max_suffix_sum + total_sum * (k - 2))
    return max(max_so_far, max_prefix_sum + max_suffix_sum)

assert max_sub_array_sum_repeated([10, 20, -30, -1], 4, 3) == 30

