def sum_of_divisors(n):
    total = 1
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            total += i
            if i != n // i:
                total += n // i
    return total

def amicable_numbers_sum(limit):
    amicable_sum = 0
    for a in range(1, limit + 1):
        b = sum_of_divisors(a)
        if b > a and sum_of_divisors(b) == a:
            amicable_sum += a + b
    return amicable_sum

assert amicable_numbers_sum(999) == 504

