def pancake_sort(arr):
    def flip(arr, k):
        return arr[:k][::-1] + arr[k:]

    n = len(arr)
    while n > 1:
        max_idx = arr.index(max(arr[:n]))
        if max_idx != n - 1:
            if max_idx != 0:
                arr = flip(arr, max_idx + 1)
            arr = flip(arr, n)
        n -= 1
    return arr

assert pancake_sort([15, 79, 25, 38, 69]) == [15, 25, 38, 69, 79]

