    n = len(arr)
    inc = [0] * n
    dec = [0] * n

    for i in range(n):
        inc[i] = arr[i]
        for j in range(i):
            if arr[j] < arr[i]:
                inc[i] = max(inc[i], inc[j] + arr[i])

    for i in range(n-1, -1, -1):
        dec[i] = arr[i]
        for j in range(n-1, i, -1):
            if arr[j] < arr[i]:
                dec[i] = max(dec[i], dec[j] + arr[i])

    max_sum = 0
    for i in range(n):
        max_sum = max(max_sum, inc[i] + dec[i] - arr[i])

    return max_sum

