def validate(num):
    str_num = str(num)
    freq = {}
    for digit in str_num:
        if digit in freq:
            freq[digit] += 1
        else:
            freq[digit] = 1
    for digit in freq:
        if freq[digit] > int(digit):
            return False
    return True

assert validate(1234) == True

def validate(num):
    freq = [0] * 10
    for digit in str(num):
        freq[int(digit)] += 1
    for i in range(10):
        if freq[i] > i:
            return False
    return True

assert validate(1234) == True

def validate(num):
    freq = {}
    for digit in str(num):
        freq[digit] = freq.get(digit, 0) + 1
    for digit, count in freq.items():
        if int(digit) < count:
            return False
    return True

