def maxAverageOfPath(matrix):
    n = len(matrix)
    m = len(matrix[0])
    dp = [[0] * m for _ in range(n)]

    dp[0][0] = matrix[0][0]

    for i in range(1, n):
        dp[i][0] = dp[i-1][0] + matrix[i][0]

    for j in range(1, m):
        dp[0][j] = dp[0][j-1] + matrix[0][j]

    for i in range(1, n):
        for j in range(1, m):
            dp[i][j] = max(dp[i-1][j], dp[i][j-1]) + matrix[i][j]

    max_sum = dp[n-1][m-1]
    path_length = n + m - 1

    return max_sum / path_length

